// src/components/LangGraphGraphic.js
import React from 'react';
import { Canvas } from '@react-three/fiber';
import { Line, OrbitControls } from '@react-three/drei';

const LangGraphGraphic = () => (
  <Canvas style={{ height: '300px' }}>
    <ambientLight intensity={0.5} />
    <OrbitControls />
    {/* Create a flowchart-like line structure */}
    <Line
      points={[[0, 0, 0], [1, 1, 0], [2, 1, 1], [3, 2, 1]]}
      color="blue"
      lineWidth={1.5}
    />
  </Canvas>
);

export default LangGraphGraphic;
